import React from 'react';

import RowTable from './RowTable'

function TableList (props){
    
    return(
    <React.Fragment>
        <table>
              <thead>
                <tr>
                {
                    props.columnName.map ((name, index)=>{
                        return <th key={index}> {name} </th>
                    })
                }
                </tr>
              </thead>

              <tbody>
                {
                    props.dataTable.map( (data, index)=>{
                    return <RowTable 
                                    dataRow = {data}
                                />
                })
                }
                    
                <tr>
                  <td>January</td>
                  <td>$100</td>
                </tr>
                <tr>
                  <td>February</td>
                  <td>$80</td>
                </tr>
              </tbody>

              <tfoot>
                <tr>
                  <td>Sum</td>
                  <td>$180</td>
                </tr>
              </tfoot>
    </table>
    </React.Fragment>
    )
}

export default TableList
